from PIL import Image

class colors:
	PURPLE = '\033[95m'
	BLUE = '\033[94m'
	GREEN = '\033[92m'
	YELLOW = '\033[93m'
	RED = '\033[91m'
	ENDC = '\033[0m'
	BOLD = '\033[1m'
	UNDERLINE = '\033[4m'

def printrgb(rgb):
	# Print formatted color as ARRRRRGG GGGBBBBB
	print(f"{colors.PURPLE}"+rgb[0]+f"{colors.RED}"+rgb[1:6]+f"{colors.GREEN}"+rgb[6:12]+f"{colors.BLUE}"+rgb[12:]+f"{colors.ENDC}  ", end='')

def torgb(b2, b1):

# Evolving based on how we interpret the format

#	ARRRRRGG GGGBBBBB
#	r = int((b2%128)/4)
#	g = (b2%4)*8 + int(b1/32)
#	b = b1%32
#	ra = r*8+int(r/16)
#	ga = g*8+int(r/16)
#	ba = b*8+int(r/16)

#	RRRRRGGG GGGBBBBB
#	r = int(b2/8)
#	g = (b2%8)*8 + int(b1/32)
#	b = b1%32
#	ra = r*8+int(r/16)
#	ga = g*4+int(r/16)
#	ba = b*8+int(r/16)

#	RRRRRRGG GGGBBBBB
#	r = int(b2/4)
#	g = (b2%4)*8 + int(b1/32)
#	b = b1%32
#	ra = r*4+int(r/16)
#	ga = g*8+int(r/16)
#	ba = b*8+int(r/16)

#	RRRRRGGG GGBBBBBA
	r = int(b2/8)
	g = (b2%8)*4 + int(b1/64)
	b = int((b1%64)/2)
	ra = r*8+int(r/16)
	ga = g*8+int(r/16)
	ba = b*8+int(r/16)
	
	#if(b1%2 == 0):
		#ra,ga,ba = (255,255,255)

	return(r,g,b,ra,ga,ba)

# Log each packet
log = True
# Create image
image = True
# Input data
data = bytes.fromhex("");

# Skip last 26 bytes (footer)
data = data[:-26]
# Skip first 22 bytes
i = 22

# Implied header: 16010A000001002000000000F0009001102000000000

if(image):
	imgdat = bytearray(b'')

while(i < len(data)):
	header = data[i]
	# Top byte indicates RLE/RAW
	if(header > 127):
		if(log):
			print("RLE",end='')
		rle = True
	else:
		if(log):
			print("RAW",end='')
		rle = False
	# Length of packet, pixels for RLE or colors for RAW
	packlen = header % 128 + 1
	# Skip header byte
	i = i + 1;
	
	if(log):
		print(str(packlen).rjust(4)+" ",end='')
	if(rle):
		# Two color bytes in LE order
		b1 = data[i]
		b2 = data[i+1]
		
		if(log):
			printrgb(format(b2, '08b')+" "+format(b1, '08b'))
		if(image):
			# bytes to 5-bit and 8-bit RGB
			r,g,b,ra,ga,ba = torgb(b2,b1)
			print(b2,b1,r,g,b)
			
			for j in range(packlen):
				imgdat.append(ra)
				imgdat.append(ga)
				imgdat.append(ba)
		
		# Skip past two color bytes
		i = i + 2
	else:
		j = 1
		while(j <= packlen):
			# Two color bytes in LE order
			b1 = data[i+j*2]
			b2 = data[i+j*2+1]
			
			if(log):
				printrgb(format(b2, '08b')+" "+format(b1, '08b'))
			if(image):
				# bytes to 5-bit and 8-bit RGB
				r,g,b,ra,ga,ba = torgb(b2,b1)
				print(b2,b1,r,g,b)
				
				imgdat.append(ra)
				imgdat.append(ga)
				imgdat.append(ba)
			
			# Next color pair
			j = j + 1
		# Skip past raw color data
		i = i + packlen*2
	if(log):
		# Need newline after all those colors
		print()

if(image):
	# Should be 288000
	print(len(imgdat))
	
	# Needs to be immutable, so convert to bytes instead of bytearray
	im = Image.frombytes('RGB', (240, 400), bytes(imgdat))
	im.save("TGAHZ.png", "PNG")
	
	print("Saved")